componentsModule.modules.mistakes={start:function(){let current=componentsModule.modules.mistakes;current.parentElement=document.querySelector("[data-component=mistakes]");current.enableCheck=current.parentElement.querySelector("[name=component_mistakes]");current.notifyBox=current.parentElement.querySelector(".component_mistakes_notify");current.notifyCheck=current.notifyBox.querySelector("[name=component_mistakes_notify]");current.emailBox=current.notifyBox.querySelector("div");current.emailCheck=current.emailBox.querySelector("input");componentsModule.initializeEvent({event:"change",element:current.parentElement,content:function(a){let target=a.target;if(target===current.enableCheck){if(!!(target.checked)){current.notifyBox.classList.remove("hide")}else{current.notifyBox.classList.add("hide")}reloadPackery()}else{if(target===current.notifyCheck){if(!!(target.checked)){current.emailBox.classList.remove("hide")}else{current.emailBox.classList.add("hide")}reloadPackery()}}}})},resume:function(){let current=componentsModule.modules.mistakes;const a=current.parentElement.getAttribute("data-resume");if(a===""){return true}const b=JSON.parse(a);current.enableCheck.checked=!!(b.mistakes);triggerEvent(current.enableCheck,"change");current.emailCheck.checked=!!(b.mistakes_email);current.notifyCheck.checked=!!(b.mistakes_notify);triggerEvent(current.notifyCheck,"change")},validate:function(){return true},serialize:function(){let current=componentsModule.modules.mistakes;return{mistakes:!!(current.enableCheck.checked),mistakes_notify:!!(current.notifyCheck.checked),mistakes_email:!!(current.emailCheck.checked)}}};